module TCMP(clk, rst, a, s);
  wire _0_;
  wire _1_;
  input a;
  input clk;
  wire dfdin;
  wire dsin;
  input rst;
  output s;
  wire z;
  NOR2X1 _2_ (
    .A(z),
    .B(a),
    .Y(_0_)
  );
  AND2X2 _3_ (
    .A(z),
    .B(a),
    .Y(_1_)
  );
  NOR2X1 _4_ (
    .A(_0_),
    .B(_1_),
    .Y(dsin)
  );
  INVX1 _5_ (
    .A(_0_),
    .Y(dfdin)
  );
  d_flip_flop dfd (
    .clk(clk),
    .d(dfdin),
    .q(z),
    .rst(rst)
  );
  d_flip_flop ds (
    .clk(clk),
    .d(dsin),
    .q(s),
    .rst(rst)
  );
endmodule

module d_flip_flop(clk, rst, d, q);
  input clk;
  input d;
  output q;
  input rst;
  DFFSR _0_ (
    .CLK(clk),
    .D(d),
    .Q(q),
    .R(rst),
    .S(1'b1)
  );
endmodule

module half_adder(a, b, s, carry);
  wire _0_;
  input a;
  input b;
  output carry;
  output s;
  NOR2X1 _1_ (
    .A(b),
    .B(a),
    .Y(_0_)
  );
  AND2X1 _2_ (
    .A(b),
    .B(a),
    .Y(carry)
  );
  NOR2X1 _3_ (
    .A(_0_),
    .B(carry),
    .Y(s)
  );
endmodule
